
CREATE TABLE LOJAS (
    COD_PESSOA NUMBER,
    ORG_LOJA NUMBER,
    COD_ORGANOGRAMA_SUB NUMBER,
    COD_ORGANOGRAMA NUMBER,
    COD_UNIDADE NUMBER,
    DES_UNIDADE VARCHAR2(255),
    DATA_INICIO DATE,
    DATA_FIM VARCHAR2(255),
    COD_REDE NUMBER,
    DES_REDE VARCHAR2(255),
    COD_EMP NUMBER,
    DES_EMAIL VARCHAR2(255),
    NUM_CELULAR VARCHAR2(255),
    COD_REGIAO NUMBER,
    EDICAO_COMPLETA VARCHAR2(255),
    NUM_CNPJ_CGC NUMBER,
    NUM_CEP NUMBER,
    TIP_LOGRA VARCHAR2(255),
    DES_LOGRA VARCHAR2(255),
    NUM_LOCAL NUMBER,
    DES_BAIRRO VARCHAR2(255),
    DES_CIDADE VARCHAR2(255),
    COD_UF VARCHAR2(255),
    PRIMARY KEY (COD_PESSOA, ORG_LOJA, COD_ORGANOGRAMA_SUB, COD_ORGANOGRAMA, COD_UNIDADE, COD_REDE)
);


